import Header from '../components/Header';

function Service() {
    return (
        <>
            <Header />
            <div className='container mx-auto'>
                <ul className='h-screen mx-8 mt-8 border-l-4 border-indigo-500'>
                    <li>
                        <p>이름</p>
                        <p>복용시간</p>
                        <p>메모</p>
                    </li>
                </ul>
            </div>
        </>
    )
}

export default Service;
